After completing the final installment of her best-selling Sex Stories trilogy in 2013, controversial French director Ovidie returns with her provocative new film, Pulsion. She explores the concept of sexual addiction, following the story of one woman's attempt to cure herself of this condition.
As always, Ovidie combines a French arthouse sensibility with explicit sexual content, telling her story from a feminist perspective.

